import React from 'react';
import './Approach.css';

const Approach = () => {
  const cardStyle = {
    border: '1px solid #ccc',
    borderRadius: '5px',
    padding: '10px',
    marginBottom: '20px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
  };

  const headerStyle = {
    color: 'blue',
    fontSize: '20px',
    marginBottom: '10px',
  };

  const paragraphStyle = {
    color: 'black',
    fontSize: '16px',
    lineHeight: '1.5',
  };

  return (
    <div className="approach-container">
      <h2 className="approach-heading">Our Approach</h2>
      <div className="card">
        <h3 className="card-header" style={{ color: 'blue' }}>Infrastructure Planning</h3>
        <p className="card-paragraph" style={{ color: 'black' }}>Our team of experts is dedicated to providing clients with the best infrastructure planning services, including but not limited to transportation planning, utilities planning, reclamation planning, traffic impact analysis, environment engineering, port and airport planning, and more.</p>
      </div>
      <div style={cardStyle}>
        <h3 style={headerStyle}>Urban Management</h3>
        <p style={paragraphStyle}>Policy formulation and training Real Estate Economics Urban Economics Master plan auditing Marketing strategies Implementation strategies Capital Investment plans</p>
      </div>
      <div style={cardStyle}>
        <h3 style={headerStyle}>Environmental Planning</h3>
        <p style={paragraphStyle}>Landscape planning Sustainability Design G.I.S Environmental Impact Assessments (E.I.A) Biodiversity impact Assessment (B.I.A)</p>
      </div>
      <div style={cardStyle}>
        <h3 style={headerStyle}>Socio-Economic Management & Urban trends</h3>
        <p style={paragraphStyle}>Social-cultural studies Demographic analysis Tourism planning Recreational planning Public spaces planning settlement action plans Livelihoods restoration plans</p>
      </div>
      <div style={cardStyle}>
        <h3 style={headerStyle}>Urban Design</h3>
        <p style={paragraphStyle}>Urban Studies Urban form & space Urban renewal & revitalization Place making & Branding Vehicular & Pedestrian systems</p>
      </div>
    </div>
  );
}

export default Approach;
